import React from 'react'

import './Header.css'

const Header = (props) => {

  return (
    <div className='nav'>
        <h1 className='nav--h1'>Spotipy</h1>
        <textarea onChange={(e) => props.changePlaylistLink(e.target.value)} value = {props.playlistLink} className='nav--text'></textarea>
        <button onClick={props.getPlaylistStats} className='nav--button'>Get Stats</button>
        <a href='https://github.com/victorleaoo/Spotify-Playlists-WebApp' target="_blank">Github</a>
    </div>
  )

}

export default Header
